import React from "react";
import "../SignUp.css";
import Logo from '../images/logo1.jpg';
import Login from '../images/logo2.jpg';
import Google from '../images/google.png';
import { Link  } from "react-router-dom";
import { Button, ButtonGroup, ButtonToolbar } from 'react-bootstrap-buttons';


function Signup() {
    return (
        <div className="container">
            <div className="row">
                <div className="col-sm-6">
                <img src={Login} className="phone" alt="..."/>
                </div>
                <div className="col-sm-6">
                    <div className="right-column text-center">
                    <img src={Logo} className="signup-logo" alt="..."/>
                        <p className="info">Sign up to see photos and videos from your friends.</p>
                        {/* <button type="submit" className="btn btn-primary btn-block">
                        <img src={Google} alt="..."/>Log in with Google
                        </button> */}
                        <p className="or">OR</p>
                        <form>
                            <div className="form-group">
                                <input type="text" className="form-control" placeholder="Username"/>
                            </div>
                            <div className="form-group">
                                <input type="password" className="form-control" placeholder="Password"/>
                            </div>
                            <button.Link to="/home" className="signup btn-primary btn-block">Login</button.Link>
                            {/* <button type="submit" className="signup btn-primary btn-block">Login</button> */}
                        </form>
                    </div>
                    <div className="right-column-login text-center">
                    <a href="#">Forgot Password?</a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Signup;
